/** Collectively stores the binary representation of an Axie gene into their respective groups. */
export interface GeneBinGroup {
    cls: string;
    region: string;
    tag: string;
    bodySkin: string;
    xMas: string;
    pattern: string;
    color: string;
    eyes: string;
    ears: string;
    horn: string;
    mouth: string;
    back: string;
    tail: string;
}
